DROP TABLE IF EXISTS `book`;
CREATE TABLE `book` (
  `bk_id` int(11) unsigned NOT NULL COMMENT '图书序号',
  `bk_code` varchar(20) NOT NULL COMMENT '图书条码',
  `bk_name` varchar(50) NOT NULL COMMENT '书名',
  `bk_author` varchar(30) NOT NULL COMMENT '作者',
  `bk_press` varchar(50) DEFAULT NULL COMMENT '出版社',
  `bk_date_press` date DEFAULT NULL COMMENT '出版日期',
  `bk_isbn` varchar(15) DEFAULT NULL COMMENT 'ISBN书号',
  `bk_catalog` varchar(30) DEFAULT NULL COMMENT '分类号',
  `bk_language` tinyint(1) unsigned DEFAULT NULL COMMENT '语言',
  `bk_pages` int(11) unsigned DEFAULT NULL COMMENT '页数',
  `bk_price` float DEFAULT NULL COMMENT '图书价格',
  `bk_date_in` date DEFAULT NULL COMMENT '入馆日期',
  `bk_brief` tinytext COMMENT '图书简介',
  `bk_cover` blob COMMENT '图书封面',
  `bk_status` varchar(2) NOT NULL COMMENT '图书状态',
  PRIMARY KEY (`bk_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

