-- ----------------------------
-- Table structure for borrow
-- ----------------------------
DROP TABLE IF EXISTS `borrow`;
CREATE TABLE `borrow` (
  `br_id` varchar(14) NOT NULL COMMENT '借阅记录号',
  `us_id` char(9) NOT NULL COMMENT '用户编号',
  `bk_id` int(11) unsigned NOT NULL COMMENT '图书序号',
  `continue_time` tinyint(1) unsigned DEFAULT '0' COMMENT '续借次数',
  `date_out` date NOT NULL COMMENT '借出日期',
  `date_return_plan` date NOT NULL COMMENT '理论应归还最晚日期',
  `date_return_fact` date DEFAULT NULL COMMENT '实际归还日期',
  `over_day` tinyint(3) unsigned DEFAULT NULL COMMENT '逾期天数',
  `over_money_plan` float DEFAULT NULL COMMENT '理论罚款',
  `over_money_fact` float DEFAULT NULL COMMENT '实际罚款',
  `has_return` char(1) DEFAULT '' COMMENT '是否归还',
  `operator_lend` varchar(10) DEFAULT '' COMMENT '借书操作员',
  `operator_return` varchar(10) DEFAULT '' COMMENT '还书操作员',
  PRIMARY KEY (`br_id`),
  KEY `us_id` (`us_id`),
  KEY `bk_id` (`bk_id`),
  CONSTRAINT `borrow_ibfk_1` FOREIGN KEY (`us_id`) REFERENCES `user` (`us_id`) ON DELETE NO ACTION ON UPDATE CASCADE,
  CONSTRAINT `borrow_ibfk_2` FOREIGN KEY (`bk_id`) REFERENCES `book` (`bk_id`) ON DELETE NO ACTION ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

