-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `us_id` char(9) NOT NULL COMMENT '用户编号（学号，职工号）',
  `us_name` varchar(10) NOT NULL COMMENT '用户姓名',
  `us_password` varchar(20) NOT NULL COMMENT '用户密码',
  `us_sex` char(1) DEFAULT NULL COMMENT '用户性别',
  `us_type` tinyint(1) unsigned NOT NULL COMMENT '用户类型',
  `us_department` varchar(20) DEFAULT NULL COMMENT '用户单位',
  `us_phone` char(11) DEFAULT NULL COMMENT '用户电话',
  `us_email` varchar(25) DEFAULT NULL COMMENT '用户邮箱',
  `us_date_register` date NOT NULL COMMENT '注册时间',
  `us_photo` blob COMMENT '用户头像',
  `us_status` char(2) NOT NULL COMMENT '用户状态',
  `us_borrow_count` tinyint(1) NOT NULL COMMENT '已借书数量',
  `us_admin_role` tinyint(1) unsigned NOT NULL COMMENT '用户管理角色',
  PRIMARY KEY (`us_id`),
  KEY `user_ibfk_2` (`us_admin_role`),
  KEY `user_ibfk_1` (`us_type`),
  CONSTRAINT `user_ibfk_1` FOREIGN KEY (`us_type`) REFERENCES `rd_type` (`rd_type_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `user_ibfk_2` FOREIGN KEY (`us_admin_role`) REFERENCES `ad_role` (`ad_role_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

